import React  from "react";
import { Link } from "react-router-dom";
import './product.css'

const Product = (props) => {
    const {id, thumbnailUrl, title} = props

    return (
        <div key={id} className="col s3 ">
            <div className="card blue-grey darken-1">
            <img className="post-img" key={id+title} alt={id} src={thumbnailUrl}></img>
            <p key={id}><Link key={id} to={`${id-1}`}>{title}</Link></p>
        </div>
    </div>
    )
}

export default Product;
